import React from 'react'
import { AppBar, Toolbar, Typography } from '@mui/material';
import './Header.css';
import logo from './images/Logo.png'
import wtsp from './images/whatsapp.png';
import lnkdn from './images/linkedin.png';
import insta from './images/instagram.png';
import { Container } from 'react-bootstrap';

const Header = () => {
    return (
        <Container>
        <React.Fragment>
            <AppBar className='Header'>
                <Toolbar className='toolbar'>
                    <div className='header-comp'>
                        <img src={logo} className='logo' alt="logo" />
                        <Typography><button className='btn'>Home</button></Typography>
                            <Typography><button className='btn'>About</button></Typography>
                            <Typography><button className='btn'>Contact</button></Typography>
                        <Typography><button className='btn'><img src={insta} alt='Instagram' /></button></Typography>
                        <Typography><button className='btn'><img src={lnkdn} alt='Linkednin' /></button></Typography>
                        <Typography><button className='btn'><img src={wtsp} alt='Whatsapp' /></button></Typography>
                    </div>
                </Toolbar>
            </AppBar>
        </React.Fragment>
        </Container>
    )
}


export default Header
